def my_func(input1: str) -> str:
    if not (1 <= len(input1) <= 20):
        return ""

    words_groups = input1.split(' ')
    result = []

    for group in words_groups:
        words = group.split('-')
        if words:
            camel_case_word = words[0] + ''.join(word.capitalize() for word in words[1:])
            result.append(camel_case_word)

    return ' '.join(result)
